 But as Ragnar leads daring raids in distant realms across the ocean, treacherous forces in his Norse homeland conspire against him. Faced with shocking betrayals and the temptations of a mysterious seductress, Ragnar must wage war on the battlefield -- and within himself -- to protect his freedom, family and life. 

